@use "../abstracts/colors" as *;
@use "../abstracts/Typography" as *;
@use "../abstracts/mixins" as *;

// Mobile view - Navbar

.navbar{
    width:100%;
    box-sizing: border-box;
    height:max(250px);
    margin:0;
    padding: 10px;
    z-index: 10;
    display:flex;
    flex-wrap: wrap;
    align-items: center;
    justify-content: center;
    background: $darker-blue;
      
    &__logo{
        margin: -70px 0 -50px;
        width:max(10%, 300px);
        height:20px;    
        
    }

    &__details{
        display:flex;
        flex-wrap: wrap;
        justify-content: center;
        color:$white;
        width:100%;
        align-items: center;
        height:max(30px);
        background: none;
        padding-top:20px;
        
    }
    &__menu{
       visibility: hidden;
    }

    
}
// Tablet view

@include tablet {
    
    .navbar{
        height:max(200px);

        &__logo{
            margin: -70px 0 -50px;
            width:max(10%, 300px);
            height:20px;         
        }
    
        &__details{
            padding:0;
            margin:30px 0 0;
            display:flex;
            flex-wrap: nowrap;
            justify-content: center;
            
        }
        &__menu{
            display:flex;
            flex-wrap: nowrap;
            justify-content:center;
            visibility: visible;
            padding:10px 0 0;
            background: none;

           &--links{
            display:flex;
            flex-wrap: nowrap;
            justify-content:center;
            color:$white;
            font-size: 1.7rem;
           }
           &--links:hover{
            color:$copper;
           }
            
        }
    }
}

// Desktop View
@include desktop {
    
    .navbar{
          padding:0;
          margin:-20px 0 0;
        &__details{
            width:60%;      
        }
        &__menu{
                        
            &--links{
                font-size: 2rem;
               }
           
        }
    }
}

