@use "../abstracts/colors" as *;
@use "../abstracts/typography" as *;
@use "../abstracts/mixins" as *;

.services{
    padding:100px 0 50px;
    background: $dark-blue;

    &__title{
        color:$white;
        background:none;
        text-align: center;
    }
    &__text{
        padding:30px 30px 20px;
        color:$grey;
    }

    &__list{
        margin-top:40px;
       background: pink;
       justify-content: center;
       align-items: center;
       padding-top:20px;
        &-links{
            background:none;
            padding:50px 40px 20px;
            h2{
                background:none; 
                padding:15px 0;
                color:$white;
                font-weight: 400;
                text-align:center;
                letter-spacing: 3px;
            }
        }
    }
}
@include tablet {
    .services {
        padding:50px 50px;

        &__list {
            
            &-links {
                display: flex;
                flex-wrap: nowrap;
                align-items: center;
                justify-content:space-around;
  
                
                h2 {
                    padding:10px;
                    font-size:min(1.3rem);           
                }
               
            }
            #kitchenBoxBackground,
            #loftBoxBackground,
            #groundworkBoxBackground {
                display:flex;
                flex-direction: row-reverse;
                flex-wrap: nowrap;  
            }
            
        }
    }
}

@include desktop {
    .services{
        padding:50px 100px;
        background:red;
        &__text{
            padding:30px 100px;
         
        }
        &__list{
           display:flex;
           flex-wrap: wrap;
            &-links{
                display:flex;
                flex-wrap: nowrap;
                flex-direction:column;
                width:33%;
                padding: 10px;
                margin:0;
                h2{
                    background:none; 
                    padding:12px 0;
                    color:$white;
                    font-weight: 400;
                    text-align:center;
                    letter-spacing: 3px;
                    height:50px;
                }
            }

            #kitchenBoxBackground,
            #loftBoxBackground,
            #groundworkBoxBackground {
                display:flex;
                flex-direction:column;
                flex-wrap: nowrap;   
            }
        }
    }
}
@include largeDesktop {
    .services {
        background:green;
        padding:100px 150px;
        
        &__text{
            padding:30px 200px;  
        }
        
    }
}

